function [indice,bornes,ref,ldr,nr,ldi,ni]=indiceor(ld)
lld=[];nn=[];
bornes=[.55,.95];ref='OR  approximation polynomiale de degre 4 de Corn   (2.04) ';
% ld microns 
indice=(29.0387-140.431*ld+254.394*ld.^2-203.936*ld.^3+61.1781*ld.^4)-1i*(5*ld.^2-16.3*ld+4.9253);
indice(ld<bornes(1)|ld>bornes(2))=nan+1i*nan;
ldr=lld;ldi=lld;nr=real(nn);ni=imag(nn);
